import * as React from 'react';
import { MDXProvider } from '@mdx-js/react';
import { AppProps } from 'next/app';
import Head from 'next/head';
import { GlobalStyle } from '../theme/globalStyle';
import { Navbar } from '../components/navbar/navbar';
import { Footer } from '../components/footer/footer';
import { MarginLarge } from '../components/ui/margins/marginLarge';
import { DefaultSeo } from 'next-seo';
import SEO from '../../next-seo.config';
import { mdxComponents } from '../components/mdx/mdxComponents';
import { ContentProvider } from '../context/ContentContext';
import { projects } from '../data/projects';
import { getAllBlogPosts } from '../data/blogPosts';
import { NavAdjustedContent } from '../components/navbar/nav.styles';
import { ThemeProvider } from '../context/ThemeContext';
import { theme } from '../theme/theme';

const myApp = ({ Component, pageProps }: AppProps) => {
  return (
    <>
      <Head>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
        <link href="https://fonts.googleapis.com/css2?family=Quicksand:wght@400;500;700" rel="stylesheet" />
        <link
          rel="icon"
          href="data:image/svg+xml,<svg xmlns=%22http://www.w3.org/2000/svg%22 viewBox=%220 0 100 100%22><text y=%22.9em%22 font-size=%2290%22>üë®‚Äçüíª</text></svg>"
        />
      </Head>
      <DefaultSeo {...SEO} />
      <MDXProvider components={mdxComponents}>
        <ThemeProvider theme={theme}>
          <ContentProvider projects={projects} blogPosts={getAllBlogPosts()}>
            <GlobalStyle />
            <Navbar />
            <NavAdjustedContent>
              <Component {...pageProps} />
            </NavAdjustedContent>
            <MarginLarge />
            <Footer />
          </ContentProvider>
        </ThemeProvider>
      </MDXProvider>
    </>
  );
};

export default myApp;
